&quot;Future Tense&quot; part 2, continued from SUPERBOY (1994-2002) #21. Unwillingly yanked into the 30th century, Superboy is none too happy about being trapped in the future, but his presence is critical to saving Valor and to stopping one of the Kid's old villains. Continued in LEGIONNAIRES (1993-2000) #31.

Thanks goes to DreamGirl for this release.

